  [],\n\t\"revision_timestamp\": \"2016-03-21T23:09:42.912932\",\n\t\"name\": \"steelhead-migration-tracking-steelhead-migration-from-the-columbia-river-through-the-pacific-oc\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Tag juvenile Columbia River steelhead in
  the Columbia estuary with acoustic tags to determine their marine distributions.
  This was a small pilot project to test our ability to 1) use fish collected by the
  Columbia Estuary Purse Seine project as a source for tagging, 2) use a mobile tagging
  station to tag 100 fish, and 3) perhaps get some detections at various fixed and
  mobile receivers in estuarine and marine waters. While many fish were detected leaving
  the estuary, only one was detected in marine waters off Willapa Bay. Since this
  is a pilot project, no reports were produced.nnField data fisheries independent
  survey. This project was foronly 1 year and no longer exists.\",\n\t\"license_title\":
